function Addmodal() {
  return (

      <div id="Addmodal" className="modal-overlay">
        <div className="modal-window">
          <div className="title">
            <h2>메뉴추가</h2>
          </div>
          <div className="content">
            <p>이름<input></input></p>
            <p>가격<input></input></p>
            <p>상품 이미지<input></input></p>
          </div>
        </div>
      </div>

  );
}

export default Addmodal;
